import { Fragment } from "react";

export default function Attribution() {
    return(
      <Fragment>
        <div className="attribution">
          Challenge by <a href="https://www.frontendmentor.io?ref=challenge" rel="noreferrer">Frontend Mentor</a>. 
          Coded by <a href="https://github.com/ruineto-dev/Challenge_FrontendMentor_Job_listings">Rui Neto</a>.
        </div>
      </Fragment>
    );
}
